import {BrowserRouter as router, Routes, Route, Router} from 'react-router-dom'
function App() {
  return (
    <Router>
      <ul>
        <li>Home</li>
        <li>Contato</li>
      </ul>

      <p>Footer</p>
    </Router>
  );
}

export default App;
